import React from "react";
import "../css/home.css";
import computer from "../images/Computertest.jpg";

const Home = () => {
    return (
        <>
            <div className="full">
                <img
                    src={computer}
                    alt="computer"
                    style={{ maxHeight: "100%", width: "100%" }}
                />
            </div>
        </>
    );
};

export default Home;
